g2:c.PROCEDURE.g2:a.TEXT:
do-all-test(node: class benchmark-node)

FD : class fft-definition;
SW : class kb-workspace;
SW-OF-CLONE : class kb-workspace;
I : class object;
J : class item;
original-connection : class -very-fine-linear-3d-connected-tu-du;
count-of-connections-in-clone : integer;
cloned-connection : class -very-fine-linear-3d-connected-tu-du;
cloned-object-received-through-connection : class object;
found-cloned-object-through-cloned-connection : truth-value;
found-unexpected-object-through-cloned-connection : truth-value;
found-self-through-cloned-connection : truth-value;
begin

  found-cloned-object-through-cloned-connection = false;
  found-unexpected-object-through-cloned-connection = false;
  found-self-through-cloned-connection = false;
  
  create an fft-definition FD by cloning ORIGINAL-OBJECT3;
  conclude that the names of FD = the symbol CLONED-OBJECT3;
  transfer FD to TEST-WS at (80,0);
  
  SW-OF-CLONE = the subworkspace of FD;

  conclude that the names of FD = the symbol CLONED-OBJECT3-SUBWORKSPACE;
  
  for i = each -very-fine-linear-3d do
    if (the workspace of i is the same object as SW-OF-CLONE) then
      conclude that the names of i is cloned--very-fine-linear-3d;
  end;
    
  count-of-connections-in-clone = 0; 
  for J = each connection connected to cloned--very-fine-linear-3d do
    begin
    count-of-connections-in-clone = count-of-connections-in-clone + 1; 
    if the class of J is -very-fine-linear-3d-connected-tu-du then
      cloned-connection = J;
    end;
  end;
  
  for i = each object connected to cloned-connection do
    if I is the same object as cloned--very-fine-linear-3d then
      found-cloned-object-through-cloned-connection = true
    else
      found-unexpected-object-through-cloned-connection = true; 
    end;
    
  for i = each object connected to  cloned--very-fine-linear-3d do
    if i is the same object as cloned--very-fine-linear-3d then
      found-self-through-cloned-connection = true;
    end;
    
  if count-of-connections-in-clone /= 1 then 
    call fail(node,"In subworkspace of cloned object there are [count-of-connections-in-clone] object(s) instead of 1]")
  else if not (found-cloned-object-through-cloned-connection) then
    call fail(node,"Didn't find cloned object through cloned connection")
  else if found-unexpected-object-through-cloned-connection then 
    call fail(node,"Found unexpecte object connected to cloned connection")
  else if not (found-self-through-cloned-connection) then
    call fail(node,"Cloned object is not connected to itself through cloned connection")
  else 
    call pass(node);
    
end
